import React from "react";
import styled from "styled-components";

const MessagesDiv = styled.div`
    padding: 5px 20px;

`

  function Messages ({messages}){
      return (
          <MessagesDiv>
              {messages.map((index) => (
              <div>
                <p>{index.user}: {index.message}</p>
              </div>
            ))}
          </MessagesDiv>
      ) 
}

export default Messages;
